var SchemaFilter={schemaClass:new Set(),onLoad:"load",remove:function(a,b){if(a===undefined){this.schemaClass=new Set()}else{if(a.constructor===Array){if(a.length>=0){this.schemaClass=new Set(a)}}if(a.constructor===Set){this.schemaClass=a}}if(b===undefined){b="micro"}switch(b){case"microdata":case"micro":SchemaFilter.removeMicroData();break;case"json-ld":SchemaFilter.removeJSONLD();break;case"rdfa":SchemaFilter.removeMicroData()}switch(b){case"microdata":case"micro":window.addEventListener(this.onLoad,function(c){SchemaFilter.removeMicroData()});break;case"json-ld":window.addEventListener(this.onLoad,function(c){SchemaFilter.removeJSONLD()});break;case"rdfa":window.addEventListener(this.onLoad,function(c){SchemaFilter.removeMicroData()});break}},removeMicroData:function(){var f=document.querySelectorAll("[itemtype]");if(f.length===0){f=document.querySelector("html")}var h=[];console.log(this.schemaClass.size);if(this.schemaClass.size!==0){for(var c=0;c<f.length;c++){var l=f[c];var g=l.getAttribute("itemtype");var k=g.split("/").pop();if(SchemaFilter.schemaClass.has(k)){h.push(l)}}}else{h=f}for(var c=0;c<h.length;c++){var d=h[c];d.removeAttribute("itemtype");var e=d.querySelectorAll("[itemprop]");for(var b=0;b<e.length;b++){var a=e[b];a.removeAttribute("itemprop");a.removeAttribute("content")}}},removeJSONLD:function(){var a=document.querySelectorAll('[type="application/ld+json"]');var g=[];for(var d=0;d<a.length;d++){var f=JSON.parse(a[d].innerHTML);if(this.schemaClass.size===0){a[d].remove();continue}g.push([a[d],f])}for(var d=0;d<g.length;d++){var c=g[d];var b=c[0];var e=c[1];if(this.schemaClass.has(e["@type"])){b.remove()}}},removeRDFa:function(){var a=document.querySelectorAll("[typeof]");var d=[];if(this.schemaClass.size!==0){for(var b=0;b<a.length;b++){var c=a[b];if(this.schemaClass.has(c.getAttribute("typeof"))){d.push(c)}}}else{d=a}d.forEach(function(g){var f=g.querySelectorAll("[property]");for(var e=0;e<f.length;e++){f[e].removeAttribute("property");f[e].removeAttribute("typeof")}})}};